import React, {useState, useEffect} from 'react';
import logo from './logo.png';
import './App.css';




function App() {

  const [load, setload ] = useState(false);

  useEffect(() => {
    setload(true)
    setTimeout(() => {
      setload(false)
    }, 1000);
  },[])
  return (
    <div className="App">
      {
        load ? (<div className="App-header"> <img src={logo} className="App-logo" title="logo" class="loading-image" width={"100%"} height={"100%"}/></div>) :
      (<div>
        <header className="App-header">
        <h1>Main page</h1>
      </header>
      <footer></footer>
      </div>
      )
      }
    </div>
  );
}

export default App;
